import classes from './Assignmentform.module.css';


const Assignmentform=()=>{

    return (
    <div className={classes.assignmentFormDiv}>
      <form>

     <la>Assignment Title</la>
       <input type="text"/>

       <div>
      Assignment Assign By</div>
       <input type="text"/>


      <div>Start Date</div>
       <input type="text"/>

      <div>Due Date</div>
       <input type="text"/>

      <div>Total Credit</div>
       <input type="text"/>

      <div>Descriptions</div>
       <input type="text"/>

       <div>Questions</div>
       <input type="text"/>

       </form>                        





    </div>
    );



};

export default Assignmentform;
